async function fetchData() {
    try {
        const response = await fetch('../../brushes.json');

        if(!response.ok) {
            throw new Error('HTTP error! Status: $(response.status');
        }

        const jsonData = await response.json();
        console.log(jsonData);

    } catch(error) {
        console.error("error");
    }
}

//fetchData();

const Product = () => {
